import React from 'react'


const Section = () => {
    return (
            <section className='section section-lg section-shaped pb-250'>
                <div className='shape shape-style-1 shape-default'>
                    <span></span>
                    <span></span>
                    <span></span>
                    <span></span>
                </div>
                <div className='separator separator-bottom separator-skew' id='separator'>
                    <svg xmlns="http://www.w3.org/2000/svg" preserveAspectRatio="none" version="1.1" viewBox="0 0 2560 100" x="0" y="0"><polygon class="fill-white" points="2560 0 2560 100 0 100"></polygon></svg>
                </div>
            </section>
    );
}


export default Section;
